export default {
	CurrentUserId: () => { return UserSelector.selectedOptionValue },
	GetUsersAverages: async () => {
		let users = await GetAllUsers.run();
		let averages = await GetAllAverages.run();
		return users.map(u => {
			u.Averages = averages.filter(a => a.UserId === u.Id);
			return u;
		});
	},
	GetCurrentUser: async (id) => { return (await Data.GetUsersAverages).find(u => u.Id === id) }
}
